import Body from './component/LandingPage/body'

function App() {
  return (
    <>
      <React.Fragment>
        {/* <HeaderAuth /> */}
        <HeaderNonAuth />
        <Jumbotron />
        <Body />
      </React.Fragment>
    </>
  )
}

export default App;
